import React from 'react';

import cv from './Docs/CV.pdf';
import logo from './image/img.png';

function Acceuil() {
    return (
        <div className="container info">
            <div className="row">
                <div className="col-md-6">zad   qad</div>
                <div className="col-md-6">qsdqSDq</div>
            </div>
            <img src={logo} alt="images" /><br />
            <h2>Mohamed Diallo</h2>
            <h1>Développeur Web</h1><br />
            <p>Alternance une semaine de formation et trois semaines en entreprise</p>
            <a href={cv} download={cv}>
                <button className="btn btn-outline-dark">Télécharger CV</button>
            </a>
            </div>
    )
}

export default Acceuil;
